INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (978, 1, 'INTEGER ALIQUET, MASSA ID LOBORTIS CONVALLIS, TORTOR RISUS DAPIBUS AUGUE, VEL ACCUMSAN TELLUS NISI EU ORCI. MAURIS LACINIA SAPIEN QUIS LIBERO.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (979, 1, 'NULLA FACILISI. CRAS NON VELIT NEC NISI VULPUTATE NONUMMY. MAECENAS TINCIDUNT LACUS AT VELIT. VIVAMUS VEL NULLA EGET EROS ELEMENTUM PELLENTESQUE. QUISQUE PORTA VOLUTPAT ERAT.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (980, 1, 'PROIN RISUS. PRAESENT LECTUS. VESTIBULUM QUAM SAPIEN, VARIUS UT, BLANDIT NON, INTERDUM IN, ANTE. VESTIBULUM ANTE IPSUM PRIMIS IN FAUCIBUS ORCI LUCTUS ET ULTRICES POSUERE CUBILIA CURAE; DUIS FAUCIBUS ACCUMSAN ODIO. CURABITUR CONVALLIS. DUIS CONSEQUAT DUI NEC NISI VOLUTPAT ELEIFEND. DONEC UT DOLOR. MORBI VEL LECTUS IN QUAM FRINGILLA RHONCUS. MAURIS ENIM LEO, RHONCUS SED, VESTIBULUM SIT AMET, CURSUS ID, TURPIS. INTEGER ALIQUET, MASSA ID LOBORTIS CONVALLIS, TORTOR RISUS DAPIBUS AUGUE, VEL ACCUMSAN TELLUS NISI EU ORCI.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (981, 1, 'VESTIBULUM ANTE IPSUM PRIMIS IN FAUCIBUS ORCI LUCTUS ET ULTRICES POSUERE CUBILIA CURAE; DONEC PHARETRA, MAGNA VESTIBULUM ALIQUET ULTRICES, ERAT TORTOR SOLLICITUDIN MI, SIT AMET LOBORTIS SAPIEN SAPIEN NON MI. INTEGER AC NEQUE.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (982, 1, 'PELLENTESQUE ULTRICES MATTIS ODIO. DONEC VITAE NISI. NAM ULTRICES, LIBERO NON MATTIS PULVINAR, NULLA PEDE ULLAMCORPER AUGUE, A SUSCIPIT NULLA ELIT AC NULLA. SED VEL ENIM SIT AMET NUNC VIVERRA DAPIBUS.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (983, 1, 'SUSPENDISSE POTENTI. CRAS IN PURUS EU MAGNA VULPUTATE LUCTUS.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (984, 1, 'CUM SOCIIS NATOQUE PENATIBUS ET MAGNIS DIS PARTURIENT MONTES, NASCETUR RIDICULUS MUS. VIVAMUS VESTIBULUM SAGITTIS SAPIEN. CUM SOCIIS NATOQUE PENATIBUS ET MAGNIS DIS PARTURIENT MONTES, NASCETUR RIDICULUS MUS. ETIAM VEL AUGUE. VESTIBULUM RUTRUM RUTRUM NEQUE. AENEAN AUCTOR GRAVIDA SEM.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (985, 1, 'MORBI SEM MAURIS, LAOREET UT, RHONCUS ALIQUET, PULVINAR SED, NISL. NUNC RHONCUS DUI VEL SEM. SED SAGITTIS. NAM CONGUE, RISUS SEMPER PORTA VOLUTPAT, QUAM PEDE LOBORTIS LIGULA, SIT AMET ELEIFEND PEDE LIBERO QUIS ORCI. NULLAM MOLESTIE NIBH IN LECTUS. PELLENTESQUE AT NULLA. SUSPENDISSE POTENTI. CRAS IN PURUS EU MAGNA VULPUTATE LUCTUS.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (986, 1, 'SUSPENDISSE POTENTI. NULLAM PORTTITOR LACUS AT TURPIS. DONEC POSUERE METUS VITAE IPSUM. ALIQUAM NON MAURIS.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (987, 1, 'IN EST RISUS, AUCTOR SED, TRISTIQUE IN, TEMPUS SIT AMET, SEM. FUSCE CONSEQUAT. NULLA NISL. NUNC NISL. DUIS BIBENDUM, FELIS SED INTERDUM VENENATIS, TURPIS ENIM BLANDIT MI, IN PORTTITOR PEDE JUSTO EU MASSA. DONEC DAPIBUS.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (988, 1, 'IN QUIS JUSTO. MAECENAS RHONCUS ALIQUAM LACUS. MORBI QUIS TORTOR ID NULLA ULTRICES ALIQUET. MAECENAS LEO ODIO, CONDIMENTUM ID, LUCTUS NEC, MOLESTIE SED, JUSTO. PELLENTESQUE VIVERRA PEDE AC DIAM. CRAS PELLENTESQUE VOLUTPAT DUI. MAECENAS TRISTIQUE, EST ET TEMPUS SEMPER, EST QUAM PHARETRA MAGNA, AC CONSEQUAT METUS SAPIEN UT NUNC. VESTIBULUM ANTE IPSUM PRIMIS IN FAUCIBUS ORCI LUCTUS ET ULTRICES POSUERE CUBILIA CURAE; MAURIS VIVERRA DIAM VITAE QUAM. SUSPENDISSE POTENTI. NULLAM PORTTITOR LACUS AT TURPIS.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (989, 1, 'INTEGER NON VELIT. DONEC DIAM NEQUE, VESTIBULUM EGET, VULPUTATE UT, ULTRICES VEL, AUGUE. VESTIBULUM ANTE IPSUM PRIMIS IN FAUCIBUS ORCI LUCTUS ET ULTRICES POSUERE CUBILIA CURAE; DONEC PHARETRA, MAGNA VESTIBULUM ALIQUET ULTRICES, ERAT TORTOR SOLLICITUDIN MI, SIT AMET LOBORTIS SAPIEN SAPIEN NON MI. INTEGER AC NEQUE. DUIS BIBENDUM. MORBI NON QUAM NEC DUI LUCTUS RUTRUM. NULLA TELLUS.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (990, 1, 'VESTIBULUM SED MAGNA AT NUNC COMMODO PLACERAT. PRAESENT BLANDIT. NAM NULLA. INTEGER PEDE JUSTO, LACINIA EGET, TINCIDUNT EGET, TEMPUS VEL, PEDE. MORBI PORTTITOR LOREM ID LIGULA. SUSPENDISSE ORNARE CONSEQUAT LECTUS. IN EST RISUS, AUCTOR SED, TRISTIQUE IN, TEMPUS SIT AMET, SEM. FUSCE CONSEQUAT.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (991, 1, 'FUSCE LACUS PURUS, ALIQUET AT, FEUGIAT NON, PRETIUM QUIS, LECTUS. SUSPENDISSE POTENTI. IN ELEIFEND QUAM A ODIO. IN HAC HABITASSE PLATEA DICTUMST. MAECENAS UT MASSA QUIS AUGUE LUCTUS TINCIDUNT.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (992, 1, 'NAM ULTRICES, LIBERO NON MATTIS PULVINAR, NULLA PEDE ULLAMCORPER AUGUE, A SUSCIPIT NULLA ELIT AC NULLA. SED VEL ENIM SIT AMET NUNC VIVERRA DAPIBUS. NULLA SUSCIPIT LIGULA IN LACUS. CURABITUR AT IPSUM AC TELLUS SEMPER INTERDUM.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (993, 1, 'CURABITUR IN LIBERO UT MASSA VOLUTPAT CONVALLIS. MORBI ODIO ODIO, ELEMENTUM EU, INTERDUM EU, TINCIDUNT IN, LEO. MAECENAS PULVINAR LOBORTIS EST. PHASELLUS SIT AMET ERAT. NULLA TEMPUS. VIVAMUS IN FELIS EU SAPIEN CURSUS VESTIBULUM.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (994, 1, 'INTEGER TINCIDUNT ANTE VEL IPSUM. PRAESENT BLANDIT LACINIA ERAT. VESTIBULUM SED MAGNA AT NUNC COMMODO PLACERAT. PRAESENT BLANDIT. NAM NULLA. INTEGER PEDE JUSTO, LACINIA EGET, TINCIDUNT EGET, TEMPUS VEL, PEDE. MORBI PORTTITOR LOREM ID LIGULA. SUSPENDISSE ORNARE CONSEQUAT LECTUS. IN EST RISUS, AUCTOR SED, TRISTIQUE IN, TEMPUS SIT AMET, SEM.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (995, 1, 'IN TEMPOR, TURPIS NEC EUISMOD SCELERISQUE, QUAM TURPIS ADIPISCING LOREM, VITAE MATTIS NIBH LIGULA NEC SEM. DUIS ALIQUAM CONVALLIS NUNC. PROIN AT TURPIS A PEDE POSUERE NONUMMY. INTEGER NON VELIT. DONEC DIAM NEQUE, VESTIBULUM EGET, VULPUTATE UT, ULTRICES VEL, AUGUE. VESTIBULUM ANTE IPSUM PRIMIS IN FAUCIBUS ORCI LUCTUS ET ULTRICES POSUERE CUBILIA CURAE; DONEC PHARETRA, MAGNA VESTIBULUM ALIQUET ULTRICES, ERAT TORTOR SOLLICITUDIN MI, SIT AMET LOBORTIS SAPIEN SAPIEN NON MI. INTEGER AC NEQUE. DUIS BIBENDUM. MORBI NON QUAM NEC DUI LUCTUS RUTRUM.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (996, 1, 'NULLAM VARIUS. NULLA FACILISI.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (997, 1, 'IN QUIS JUSTO.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (998, 1, 'INTEGER A NIBH. IN QUIS JUSTO. MAECENAS RHONCUS ALIQUAM LACUS. MORBI QUIS TORTOR ID NULLA ULTRICES ALIQUET. MAECENAS LEO ODIO, CONDIMENTUM ID, LUCTUS NEC, MOLESTIE SED, JUSTO.');
INSERT INTO ARTICLE_COMMENT (ARTICLE_COMMENT_ID, ARTICLE_ID, CONTENTS) VALUES (999, 1, 'FUSCE CONSEQUAT.');
